import "./css/contact.css"

function ContactPage() {
    return ( 
    <div className="contact">
        <article>
            My Mobile Phone number: <b>778-861-8003</b> 
            <br />
            My Email: <b>kedong0213@gmail.com</b>
        </article>
    </div>
    );
}

export default ContactPage;
